public class InterchangeNumber {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int x=10;
		int y=20;
		
		
		x=x+y;
		y=x-y;
		x=x-y;
		
		System.out.println("X: "+x+"  Y:"+y);
		
		System.out.print(10+20+30+"test");
		
		System.out.println("test"+10+20+30);
		
		

	}

}
